import React from 'react'
import Todo from './Todo'

const Todolist = (props) => {
  const list = props.todos.map(item=>{
    // return <Todo item={item} key={item.id}/>
    return <Todo key={item.id} item={item}/>
  })
  return (
    <div> 
      {list}
    </div>
  )
}

export default Todolist
